import React from 'react'
import styled from 'styled-components'
import '../App.css';



function Home() {
    return (
        <Container >

            <ContainerInside>
                <p>----  GET HELP. GET BETTER.  ----</p>
            </ContainerInside>
            <Content>       
             <p>A place to feel better,wherever you go!</p> 
            </Content>
            <ContainerInsider>



            </ContainerInsider>



        </Container>
    )
}

export default Home
// min-height: calc(100vh - 70px);
// padding: 0 calc(3.5vw + 5px);
const ContainerInside = styled.main`

p{
    font-height:19px;
    width:522px;
    color:red;
    letter-spacing:5px;
    margin:155px 738px 0px 180px;

}


`

const Content=styled.div`
height:30px;
width:30px;


`




const ContainerInsider = styled.div`



`

const Container = styled.div`
height:684px;
width:1440px;

position:relative;
overflow:hidden;

`
